import React from 'react';

import {
    MDBNavbar,
    MDBNavbarNav,
    MDBNavbarItem,
    MDBNavbarLink,
    MDBNavbarToggler,
    MDBContainer,
    MDBIcon } from 'mdb-react-ui-kit';


import styles from './mystyle.module.css'; 
const Header = () => {
    return(
            <header>
                <MDBNavbar expand="lg" light bgColor="white">
                    <MDBContainer fluid>
                        <MDBNavbarToggler
                            aria-controls="navbarExample01"
                            aria-expanded="false"
                            aria-label="Toggle navigation">
                                <MDBIcon fas icon="bars"/>
                            </MDBNavbarToggler>
                            <div className='collapse navbar-collapse' id='navbarExample01'>
                            <MDBNavbarNav right className='mb-2 mb-lg-0'>
                            <MDBNavbarItem active>
                                <MDBNavbarLink aria-current='page' href='#'>
                                Home
                                </MDBNavbarLink>
                            </MDBNavbarItem>
                            <MDBNavbarItem>
                                <MDBNavbarLink href='#'>Features</MDBNavbarLink>
                            </MDBNavbarItem>
                            <MDBNavbarItem>
                                <MDBNavbarLink href='#'>Pricing</MDBNavbarLink>
                            </MDBNavbarItem>
                            <MDBNavbarItem>
                                <MDBNavbarLink href='#'>About</MDBNavbarLink>
                            </MDBNavbarItem>
                            </MDBNavbarNav>
                        </div>
                        </MDBContainer>
                    </MDBNavbar>
            </header>



    
    // return (
    //     <div id="header" className={styles.jumbotron}>
    //         <h1>Graph Maker</h1>
    //         <hr/>
    //         <p>Create any ammount of graphs and use it on your page using iframes</p>
    //         <br/>
    //         <br/>
        
    //         <form>
    //             <div class="input-group">
                
    //                 <div class="input-group-btn">
                   
    //                     <button type="button" id="createGraph" class="btn btn-danger">Create your graphicon</button>
    //                 </div>
    //             </div>
    //         </form>
    // </div>
    // )
    )
}

export default Header;
